    <style>
        html,
        body {
            max-width: 100%;
            overflow-x: hidden;
            overflow-y: hidden;
        }
        
        #body {
            background: -webkit-linear-gradient(#D40F8C, #592873);
            background: -moz-linear-gradient(#D40F8C, #592873);
            background: linear-gradient(#D40F8C, #592873);
        }
        
        #submit {
            color: #999;
        }
        
         ::placeholder {
            color: black;
            opacity: 1;
            /* Firefox */
        }
        
         :-ms-input-placeholder {
            /* Internet Explorer 10-11 */
            color: black;
        }
        
         ::-ms-input-placeholder {
            /* Microsoft Edge */
            color: black;
        }
        
        .inner-div {
            display: inline-block;
            padding: 2.8vh;
            width: 40vw;
            height: 80vh;
            position: absolute;
            top: 0;
            bottom: 0;
            right: 0;
            left: 0;
            margin: auto;
        }
        
        h1 {
            color: white;
            margin: .46vh 0;
            font-size: 3.5vh;
        }
        
        body {
            background-image: url(https://desktopwalls.net/wp-content/uploads/2014/07/New%20York%20City%20USA%20Black%20White%20Buildings%20Top%20View%20Desktop%20Wallpaper.jpg);
            background-position: center;
            height: 100vh;
            width: 100vw;
        }
        
        input {
            width: 18.23vw;
            height: 5vh;
            margin: .741vh 0;
            display: inline-block;
            border: 1px solid #ccc;
            border-radius: .37vh;
            box-sizing: border-box;
            margin-bottom: 1vh;
            text-align: center;
            font-size: 1.7vh;
        }
        
        select {
            width: 18.23vw;
            height: 5vh;
            margin: .741vh 0;
            display: inline-block;
            border: 1px solid #ccc;
            border-radius: .37vh;
            box-sizing: border-box;
            margin-bottom: 1vh;
            text-align: center;
            text-align-last: center;
            font-size: 1.7vh;
        }
        
        input[type=button] {
            width: 18.23vw;
            background-color: #4CAF50;
            color: white;
            margin: .741vh 0;
            border: none;
            border-radius: .37vh;
            cursor: pointer;
            font-size: 1.7vh;
        }
        
        input[type=button]:hover {
            background-color: #45a049;
        }

            sqs.sendMessage(params, function(err, data) {
                if (err) alert(err, err.stack); // an error occurred
                else alert('Email was a success! Results will be in your inbox shortly. If not, check the spam folder or try again.'); // successful response
            });

            clearFields();
        }

        function clearFields() {
            var start = new Date().getTime();
            for (var i = 0; i < 1e7; i++) {
                if ((new Date().getTime() - start) > 50000) {
                    break;
                }
            }

            document.forms["submitValues"]["category"].value = "";
            document.forms["submitValues"]["subcategory"].value = "";
            document.forms["submitValues"]["goal"].value = "";
            document.forms["submitValues"]["creation_time"].value = "";
            document.forms["submitValues"]["duration"].value = "";
            document.forms["submitValues"]["city_name"].value = "";
            document.forms["submitValues"]["state"].value = "";
            document.forms["submitValues"]["country"].value = "";
            document.forms["submitValues"]["currency"].value = "";
            document.forms["submitValues"]["email"].value = "";
        }
    </script>
</head>
